class User {
    private id: number;
    private username: string;
    private email: string;

    constructor(id: number, username: string, email: string) {
        this.id = id;
        this.username = username;
        this.email = email;
    }

    // Méthodes pour accéder et modifier les attributs privés
    getId(): number {
        return this.id;
    }

    getUsername(): string {
        return this.username;
    }

    getEmail(): string {
        return this.email;
    }

    setEmail(email: string): void {
        this.email = email;
    }
}

// Exemple d'utilisation
const user1 = new User(1, 'john_doe', 'john@example.com');
console.log(user1.getId()); // 1
console.log(user1.getUsername()); // john_doe
console.log(user1.getEmail()); // john@example.com

user1.setEmail('john.doe@example.com');
console.log(user1.getEmail()); // john.doe@example.com
